                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Script":
                    FormKeyXmlTranslation.Instance.ParseInto(
                        root: root,
                        item: item.Script_Property,
                        fieldIndex: (int)Book_FieldIndex.Script,
                        errorMask: errorMask);
                    break;
                case "Enchantment":
                    FormKeyXmlTranslation.Instance.ParseInto(
                        root: root,
