        public static Book Copy(
            IBook item,
            Book_CopyMask copyMask = null,
            IBookGetter def = null)
        {
            Book ret;
            if (item.GetType().Equals(typeof(Book)))
            {
                ret = new Book();
            }
            else
            {
                ret = (Book)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

